import Sidebar from "./Sidebar"
import styles from "./layout.scss"

const Layout = () => {
  return (
    <div className={styles.app}>
      <main>
        <Sidebar />
        <section className={styles.features}>
          <Outlet />
        </section>
      </main>
    </div>
  )
}

export default Layout;
